import React from 'react';
import '../CSS/Position_Modal.css';

const Position_Modal: React.FC = () => {
  return (
    <div className="position-modal">
      <h2>Position Modal</h2>
      <p>位置に関する詳細情報がここに表示されます。</p>
    </div>
  );
};

export default Position_Modal;
